    return (
        <div className={DarkMode?"individual-page dark-individual-page":"individual-page"}>
        <Header setDarkMode={setDarkMode} DarkMode={DarkMode}/>
        <CountryPage setDarkMode={setDarkMode} DarkMode={DarkMode}/>
        </div>
    )
}
